import React from 'react';
import style from './style.module.css';
import Counter from '../Counter';

import Гыук from './252.png';
import Git from './git.png'

export default () => {

    return (
        <main>
            <div className={style.Container}>
                <div className={style.Profile}>
                    <div className={style.UserHolder}>
                        <h1>John Doe Profile</h1>
                        <img alt="photo" src={Photo} />
                    </div>
                    <div className={style.SubscriptionsHolder}>
                        <Counter name="Followers" />
                        <Counter name="Following"/>
                    </div>
                </div>
                <div className={style.GitLogo}>
                        <img alt="gitlogo" src={Git} />
                </div>
            </div>
        </main>

    )
}
